INSERT INTO `wmv_faq` (`id`, `lang_code`, `title`, `text`, `order`, `reg_date`) VALUES
(1, 'en', 'WHEN DO YOU SEND SIGNALS EVERY DAY?', 'Usually, we work in London and New York sessions. You will get signals during a day.', 1, '2021-08-15 23:23:05'),
(2, 'en', ' WHAT IS YOUR SIGNALS\' TYPES? PENDING OR MARKET ORDERS?', 'Generally, we use all types of signals: market orders, direct sell or buy orders, sell/buy limit and sell/buy stop orders.', 1, '2021-08-15 23:23:05'),
(3, 'en', 'WILL YOU INFORM US FOR HOLDING OR CLOSING OF OUR POSITIONS?', 'Yes. Our multilingual support and your personal manager will send you broadcast message regarding to signals. You can also decide for holding or closing orders.', 1, '2021-08-15 23:23:38'),
(4, 'en', ' WHICH BROKERS DO YOU ADVICE FOR FOREX AND GOLD SIGNALS?', 'We can advice Pepperstone, Tickmill, ICMarkets, XM and etc. These are reliable brokers.', 1, '2021-08-15 23:23:38'),
(5, 'en', 'WHICH CRYPTO BROKERS CAN YOU ADVICE FOR YOUR SIGNALS?', 'Our crypto signals is for Binance, Huobi and Gate IO brokers. Signals is for altcoins only.', 1, '2021-08-15 23:24:02'),
(6, 'en', ' WHAT IS YOUR SIGNALS\' FORMAT?', 'Our signals is sending by Whatsapp and format is such:\r\n\r\nForex:\r\nUSD/CHF\r\nBuy at 0.8975\r\nTake Profit 0.9020\r\nStop Loss 0.8950\r\nGold:\r\nXAUUSD\r\nSell at 1880.50\r\nTake Profit 1860.00\r\nStop Loss 1890.25\r\nCrypto:\r\nBroker Binance\r\nAltcoin ICP/BNB\r\nMarket order - buy at 0.5185\r\nTake Profit 1.0', 1, '2021-08-15 23:24:02'),
(7, 'en', ' WHICH BROKER IS SUITABLE FOR PAIR BOMBER EA?', 'We can advice any broker with low spreads and slippage.', 1, '2021-08-15 23:24:24'),
(8, 'en', ' I SAW THAT YOU ACCEPT ONLY USDT. CAN WE PAY WIH OTHER CRYPTOS?', 'Yes, we accept USDT because it is equal to 1$ and it has in all crypto brokers. You can pay necessary amount with TRC20 protocol.', 1, '2021-08-15 23:24:24'),
(9, 'en', 'DO YOU SEND SIGNALS OVER WHATSAPP ONLY OR CAN WE USE ACCEPT SIGNALS IN TELEGRAM ALSO?', 'We send signals via WhatsApp yet. It is easy and all members can download or set it up quickly.', 1, '2021-08-15 23:24:51');

