INSERT INTO `wmv_what_offer` (`id`, `lang_code`, `title`, `text`, `order`, `reg_date`) VALUES
(1, 'en', 'Forex Signals', '<p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">Trading currencies is hard and let’s face it – you don’t have the time to follow every\r\n                            squiggle in price, every news release or every comment that can affect your trade. That’s\r\n                            why we developed an easy to use, highly refined approach to trading the forex market that\r\n                            allows you to participate in the major currency moves without being overwhelmed by the\r\n                            thousand little details of trading.By acting as your eyes and ears on the market we help you\r\n                            select the most promising trading ideas.. But that’s not all. We’ve developed a system that\r\n                            allows you to preset your trades and then once they trigger, to comfortably manage them at\r\n                            your leisure. </span></p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n\r\n                        </span><span style=\"font-size: 16px;\">\r\n</span>\r\n<p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">At Pro Signals we are always looking to improve our signal service for the Retail Trader and\r\n                            after 5 years and more than 46500+ pips of profit we have now refined our operation to make\r\n                            it even easier to execute our ideas. All of our trade recommendations come with a\r\n                            well-researched Trading Plan which includes:</span></p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><br /><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><span class=\"style1\" style=\"color: rgb(0, 0, 0); font-size: 16px;\">►</span><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">Our reasons for the trade</span><br /><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><span class=\"style1\" style=\"color: rgb(0, 0, 0); font-size: 16px;\">►</span><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">The currency pair that we will be trading</span><br /><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><span class=\"style1\" style=\"color: rgb(0, 0, 0); font-size: 16px;\">►</span><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">Specific entries, exits and stops which are sent out via our\r\n                        WhatsApp broadcast list</span><br /><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><br /><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><span style=\"font-size: 16px;\">\r\n</span>\r\n<p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">All of our trade recommendations are sent as entry orders. This means that we are always\r\n                            trading away from the current market price (we try to sell below or buy above the present\r\n                            market conditions). This not only allows us to position ourselves in the direction of where\r\n                            the prices are moving, but also provides you with ample time to place your orders and go\r\n                            about your regular daily life, instead of being chained to the screen.</span></p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">\r\n                        </span><span style=\"font-size: 16px;\">\r\n</span>\r\n<p><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">Hopefully by now you’re starting to see why we at Pro Signals Company offer this service to\r\n                            our clients. There are a few benefits to using a Forex signal tool to help you make your\r\n                            investment decisions. The live nature of these services is critical – you aren’t relying on\r\n                            data that’s already hours out of date but instead receive alerts ‘as they happen’. You’re\r\n                            also simplifying the information and receiving clear guidance with less research, something\r\n                            that will benefit you immensely if you happen to be a novice trader. This will allow you to\r\n                            focus your attention where it really matters- your Forex account and trades. It’s also a\r\n                            good way to slowly introduce yourself to more market information and learn about the trading\r\n                            process, without the need to tie yourself to a desk. You get knowledge at your fingertips,\r\n                            which will allow you to jump into trading immediately while still making knowledgeable\r\n                            decisions, and simply live a trading life that’s less stressful and pressured. Overall,\r\n                            Forex signals give you valuable Forex data timeously, while providing a guiding hand to help\r\n                            you make the best possible decisions for your investment account. They’re an excellent tool\r\n                            to make Forex trading a little less stressful and a lot more productive.</span></p>', 1, '2021-08-15 23:55:31'),
(2, 'en', 'Scalping Signals', '<p class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">Scalping Signal service is provided by high-experienced Forex traders. Our team have been working as a trader-analyst in the financial market since 2008. We decided to offer new service as Scalping Signals. This is for all traders who want to get quick and profitable orders. Scalping signals are more popular in these days because it has more profitability.&nbsp;</p>\r\n<p class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\"><br /></p>\r\n<p class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">We use short-term Forex Strategy which it is consist of some indicators\' combinations. Strategy is working in M30-H1 timeframe and that\'s why we are be able to send high-profitable Scalping Signals with 15-20 pips TP to our paid members. Also, we offer Gold Scalping Trade Copier Service also. This system is working locally on our server. We connect to your account by using your account credentials. And all of our signals copy to your account directly and automatically within 0.25 second. When we close our orders in master account then same orders will close in all client accounts at moment.</p>\r\n<p class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\"><br /></p>\r\n<ul style=\"list-style-type: square;\">\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">We send 4 - 6 signals daily.</li>\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">Signals on some currencies and&nbsp; GOLD only.</li>\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">Our accuracy is 90%.</li>\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">Signals send via Whatsapp broadcast list.</li>\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">We send market orders only.</li>\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">Each signal has one take profit (TP).</li>\r\n  <li class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px; text-align: left; color: rgb(0, 0, 0); font-family: Exo, sans-serif; font-size: 16px;\">We trade on New York and London sessions.</li>\r\n</ul>', 1, '2021-08-15 23:55:31'),
